import { Grid, Icon, Segment, Image, Form, Input, Divider, Label, Button, Container, } from 'semantic-ui-react'
import axios  from 'axios';
import { useParams } from 'react-router';
const LandlordAccountReview = () => {
  const [username, setUsername] = useState('')
  const [email, setEmail] = useState('')
  const [phone, setPhone] = useState('')
  const [account, setAccount] = useState({})
  const params = useParams()
  const landlordid = params.id
  const updateAccount = async ()=>{
    try {
      const account = await axios.put(`http://localhost:5000/api/auth/updateaccount/${landlordid}`)

    } catch (error) {

    }
  }

  return (
    <div style={{ minHeight: "100vh"}}>

      <Grid style={{ marginTop: "5px"}} >
        <Grid.Column width="3"></Grid.Column>
        <Grid.Column  width={13}>
          <Segment
            textAlign='bottom'
            style={{
              backgroundImage: "url(/des2.jpg)",
              height: "20vh"
            }}
          >
            <Image src='https://react.semantic-ui.com/images/avatar/small/matthew.png' circular size='small' />
          </Segment>
          <Divider hidden />
          <Divider hidden />
          <Grid textAlign='center'>
            <Grid.Column floated='left' width={13}>
              <Label size='big'>
                My Account
              </Label>
            </Grid.Column>
            <Grid.Column floated='right' width={3}>
              <Button>
                <Icon name='save' />
                Save
              </Button>
            </Grid.Column>
          </Grid>
          <Divider />
          <Grid textAlign='left'>


            <Form>
              <Form.Field inline>
                <label>User Name</label>
                <Input placeholder='First name' />
              </Form.Field>
              <Form.Field inline>
                <label>Email</label>
                <Input placeholder='First name' />
              </Form.Field>
              <Form.Field inline>
                <label>Phone</label>
                <Input placeholder='First name' />
              </Form.Field>


            </Form>

          </Grid>

        </Grid.Column>

      </Grid>

    </div>
  )
}

export default LandlordAccountReview
